import React, { useEffect, useState } from 'react'
import Drawn from './Drawn'

export default function Dragonfly() {
  const [drawn, setDrawn] = useState({ cards: [] })

  useEffect(async () => {
    const res = await fetch('http://localhost:3000/spreads/dragonfly')
    setDrawn(drawn)
  })

  return (
    <div>
      {drawn}
    </div>
  )
}
